        keys.sort();

        for (k=0; k<keys.length; k++)
        {
          key=keys[k];
          sfeatures+=key+'='+features[key]+'<br>';
        }
     }

     var size=5;
     if ("size" in ps) size=ps.size;

     var color="#0000bf";
     if ("color" in ps) color=ps.color;

     var connect_lines=false;
     if (("connect_lines" in ps) && (ps.connect_lines=="yes"))
        connect_lines=true

     if ('point_uid' in inf) dat['subpoint']=inf.point_uid;
     if (cid!='') dat['cid']=cid;
     if ('type' in ps) dat['type']=ps.type; 

     if ('url' in inf) dat['url']=inf.url;
     if ('url_ext' in inf) dat['url_ext']=inf.url_ext;

     var xx=data[q][0];
     var yy=data[q][1];

     /* Y variation */
     if (yerr2=='yes') {
        var yy1=data[q][2];

        size=size/1.3;

        svg.append("svg:line")
            .attr("x1", xScale(xx))
            .attr("x2", xScale(xx))
            .attr("y1", yScale(yy))
            .attr("y2", yScale(yy1))
            .style("stroke", color)
            .style("stroke-width", "1.5");

/*
        svg.append("svg:line")
            .attr("x1", xScale(xx)-4)
            .attr("x2", xScale(xx)+4)
            .attr("y1", yScale(yy))
            .attr("y2", yScale(yy))
            .style("stroke", color)
            .style("stroke-width", "1.5");
*/

        svg.append("svg:line")
            .attr("x1", xScale(xx)-4)
            .attr("x2", xScale(xx)+4)
            .attr("y1", yScale(yy1))
            .attr("y2", yScale(yy1))
            .style("stroke", color)
            .style("stroke-width", "1.5");

     }

     dat['x']=xx;
     dat['y']=yy;
     dat['size']=size;
     dat['color']=color;
     dat['features']=sfeatures;
     dat['info']=inf

     adata.push(dat);

     if (connect_lines && q!=0) {
        svg.append("svg:line")
            .attr("x1", xScale(xlast))
            .attr("x2", xScale(xx))
            .attr("y1", yScale(ylast))
            .attr("y2", yScale(yy))
            .style("stroke", ""+color);
     }

     xlast=xx;
     ylast=yy;
   }
}

// check hlines
h_lines=[];
for (q=0; q<h_lines.length; q++) {
    v=h_lines[q];
    svg.append("svg:line")
        .attr("x1", 5)
        .attr("x2", width+10)
        .attr("y1", yScale(v))
        .attr("y2", yScale(v))
        .style("stroke", "rgb(189, 189, 189)");
}

// check vlines
v_lines=[];
for (q=0; q<v_lines.length; q++) {
    v=v_lines[q];
    svg.append("svg:line")
        .attr("x1", xScale(v))
        .attr("x2", xScale(v))
        .attr("y1", 5)
        .attr("y2", height+10)
        .style("stroke", "rgb(189, 189, 189)");
}

// draw dots
svg.selectAll(".dot")
   .data(adata)
   .enter()

   .append("circle")
   .attr("r", function(d) {return d.size})
   .attr("cx", xMap)
   .attr("cy", yMap)
   .style("fill", function(d) {return d.color})

   .on("click", function(d) {
      var cid='';
      if ('cid' in d) {
         cid=d['cid'];

         var subpoint='';
         if ('subpoint' in d) subpoint=d['subpoint'];

         window.open("$#ck_root_url#$wcid="+cid+'&subpoint='+subpoint);
      } else {
         var url='';
         if ('url' in d) {
            url=d['url'];
            var url_ext='';
            if ('url_ext' in d)
               url_ext=d['url_ext'];
            window.open(url+url_ext);
         }
      }
   })

   .on("mouseover", function(d) {
       tooltip_scatter.transition()
            .duration(200)
            .style("opacity", .9);
       tooltip_scatter.html("<div style=\"text-align:left;background-color:yellow;opacity:0.8;filter:alpha(opacity=80);\"><small><b>x=" + xValue(d) + ", y=" + yValue(d) + "</b><br>"+d.features+"\n</small></div>")
            .style("left", (d3.event.pageX + 5) + "px")
            .style("top", (d3.event.pageY - 28) + "px");
   })

   .on("mouseout", function(d) {
       tooltip_scatter.transition()
            .duration(500)
            .style("opacity", 0);
   });

</script>
